import React from "react";
const Beginning = () => {
  return (
    <div className="begining">
      <h1 className="begining__title">Welcome to the fitness life app!!</h1>
      <h2 className="begining__subtitle">
        If you like to take care of yourself, you will love this app.
      </h2>
      <h3 className="begining__text">
        Here you will find different exercises for your daily training and
        several healthy cooking recipes.
      </h3>
    </div>
  );
};
export default Beginning;
